import React from 'react';
import {Link} from "react-router-dom";

let MainNavbar = ({title}) => {
    return (
        <>
            <nav className="navbar navbar-expand-lg  navbar-dark bg-secondary">
            
        <img   style={{borderRadius:'50%',marginRight:'10px'}} src="https://thumbs.dreamstime.com/z/university-campus-building-hall-education-students-cartoon-vector-illustration-brotherhood-smart-nerd-classes-hipster-young-155883209.jpg" width="40" height="40" alt="" />

          
        
                <div className="container-fluid">
                    
                    <a href="/" className="navbar-brand">{title}</a>
                </div>
            </nav>
        </>
    )
};
export default MainNavbar;
